window.bookSummaryJSON = "<p>Charming, charismatic, and effortlessly popular, Conrad Stewart seems to have it all...but in reality, he's scrambling to keep his life from tumbling out of control. </p> <p>Brilliant, guarded, and endlessly driven, Alden Roth may as well be the poster boy for perfection...but even he can't help but feel a little broken inside. </p> <p>When these mortal enemies are stuck together on a cross-country road trip to the biggest fan convention of their lives, their infamous rivalry takes a backseat as an unexpected connection is forged. Yet each has a reason why they have to win the upcoming Odyssey gaming tournament, and neither is willing to let emotion get in the way - even if it means giving up their one chance at something truly magical.</p>"; 
